/*
-- Query verifica atleti CSI
select concat(ta.name, '-', s.complete_name) as chiave, ta.name, s.complete_name, s.year_of_birth, (2019 - s.year_of_birth) as age, b.number, b.team_id, b.swimmer_id, b.team_affiliation_id, b.id as badge_id, t.name
from badges b
        join seasons sn on sn.id = b.season_id
	join teams t on t.id = b.team_id
	join team_affiliations ta on ta.id = b.team_affiliation_id
	join swimmers s on s.id = b.swimmer_id
where sn.id = 181
order by ta.name, s.complete_name;
*/

